use `encuestadocpostgrado_joomla3`;
CREATE TABLE carrera
(
	`codigo_asig`	VARCHAR(512) PRIMARY KEY,
	`nombre`	VARCHAR(512),
	`codigo_programa`	INT
);
CREATE TABLE estudiante
(
	`nombre`	VARCHAR(512),
	`apellido`	VARCHAR(512),
	`email`	VARCHAR(512),
	`nombre_especialidad`	VARCHAR(512),
	`nombre_campo_clinico`	VARCHAR(512),
	`rut`	INT PRIMARY KEY,
	`codigo_programa`	INT,
	`codigo_asig`	VARCHAR(512),
	FOREIGN KEY (`codigo_asig`) REFERENCES carrera(`codigo_asig`)
);
CREATE TABLE encuesta
(
	`rut`	INT PRIMARY KEY,
	`codigo_programa`	INT,
	`codigo_asig`	VARCHAR(512),
	FOREIGN KEY (`rut`) REFERENCES estudiante(`rut`),
	FOREIGN KEY (`codigo_programa`) REFERENCES estudiante(`codigo_programa`),
	FOREIGN KEY (`codigo_asig`) REFERENCES estudiante(`codigo_asig`)
);
